pragma solidity 0.8.9;

import "./Ad.sol";

library Purchase {
	function checkBeforeBuy(Ad.Period memory period) external view {
		require(period.pricing == Ad.Pricing.RRP, "KD120");
		require(!period.sold, "KD121");
		require(period.minPrice == msg.value, "KD122");
	}

	function checkBeforeBuyBasedOnTime(
		Ad.Period memory period,
		uint256 currentPrice
	) external view {
		require(period.pricing == Ad.Pricing.DUTCH, "KD123");
		require(!period.sold, "KD121");
		require(currentPrice <= msg.value, "KD122");
	}

	function checkBeforeBid(
		Ad.Period memory period,
		uint256 currentPrice,
		uint256 blockTimestamp
	) external view {
		require(period.pricing == Ad.Pricing.ENGLISH, "KD124");
		require(!period.sold, "KD121");
		require(currentPrice < msg.value, "KD122");
		require(period.saleEndTimestamp >= blockTimestamp, "KD129");
	}

	function checkBeforeBidWithProposal(
		Ad.Period memory period,
		uint256 blockTimestamp
	) external view {
		require(period.pricing == Ad.Pricing.OPEN, "KD127");
		require(!period.sold, "KD121");
		require(period.minPrice <= msg.value, "KD122");
		require(period.saleEndTimestamp >= blockTimestamp, "KD129");
	}
}
","keccak256":"0x75b504f12f93fbb1be78980dad98029366c4947118eea0f232680b3c5c35123a","license":"UNLICENSED"},"contracts/libraries/Sale.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.9;

import "./Ad.sol";

library Sale {
	struct Bidding {
		uint256 tokenId;
		address bidder;
		uint256 price;
	}
	struct Offer {
		string spaceMetadata;
		uint256 displayStartTimestamp;
		uint256 displayEndTimestamp;
		address sender;
		uint256 price;
	}
	struct OpenBid {
		uint256 tokenId;
		address sender;
		uint256 price;
		string content;
	}

	function startPrice(Ad.Period memory period) internal pure returns (uint256) {
		if (period.pricing == Ad.Pricing.RRP) {
			return period.minPrice;
		} else if (period.pricing == Ad.Pricing.DUTCH) {
			return period.minPrice * 10;
		} else if (period.pricing == Ad.Pricing.ENGLISH) {
			return period.minPrice;
		} else if (period.pricing == Ad.Pricing.OFFER) {
			return period.minPrice;
		} else if (period.pricing == Ad.Pricing.OPEN) {
			return period.minPrice;
		} else {
			return 0;
		}
	}
}
